import Expenses from "./components/Expenses";
function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 495.87,
      date: new Date(2022, 8, 14),
    },
    {
      id: "e2",
      title: "Toilet Paper",
      amount: 595.87,
      date: new Date(2022, 6, 24),
    },
    {
      id: "e3",
      title: "Room Rent",
      amount: 695.87,
      date: new Date(2022, 2, 18),
    },
    {
      id: "e4",
      title: "Groceries",
      amount: 295.87,
      date: new Date(2022, 10, 21),
    },
  ];
  return <Expenses items={expenses}></Expenses>;
}

export default App;
